#searchBox {
    position: absolute;
    top: 0;
    left: 40px;
    width: 40px;
    height: 40px;
    padding: 0 0 0 40px;
    font-size: 14px;
    line-height: 1;
    color: #8d9398;
    border: 0;
    background-color: transparent;
    background-image: url('https://cdn.rawgit.com/incace/matFlow/8b045097/assets/searching-grey.svg');
    background-repeat: no-repeat;
    background-position: 8px 9px;
    background-size: auto 24px;
    border-radius: 0;
    -webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    opacity: 1;
}

#searchBox:focus,
#searchBox:hover {
    outline: none;
    width: 200px;
    background-color: #495157;
    background-image: url('https://cdn.rawgit.com/incace/matFlow/8b045097/assets/searching.svg');
    background-repeat: no-repeat;
    background-position: 8px 9px;
    background-size: auto 24px;
    cursor: default;
}

#searchBox::-webkit-input-placeholder {
    color: #8d9398;
    -moz-transition: all 250ms ease;
    -o-transition: all 250ms ease;
    -webkit-transition: all 250ms ease;
    transition: all 250ms ease;
    text-transform: uppercase;
    font-weight: 700;
}

#searchBox:-moz-placeholder {
    color: #8d9398;
    -moz-transition: all 250ms ease;
    -o-transition: all 250ms ease;
    -webkit-transition: all 250ms ease;
    transition: all 250ms ease;
    text-transform: uppercase;
    font-weight: 700;
}

#searchBox::-moz-placeholder {
    color: #8d9398;
    -moz-transition: all 250ms ease;
    -o-transition: all 250ms ease;
    -webkit-transition: all 250ms ease;
    transition: all 250ms ease;
    text-transform: uppercase;
    font-weight: 700;
}

#searchBox:-ms-input-placeholder {
    color: #8d9398;
    -moz-transition: all 250ms ease;
    -o-transition: all 250ms ease;
    -webkit-transition: all 250ms ease;
    transition: all 250ms ease;
    text-transform: uppercase;
    font-weight: 700;
}

#searchBox:focus::-webkit-input-placeholder {
    color: transparent;
}

#searchBox:focus:-moz-placeholder {
    color: transparent;
}

#searchBox:focus::-moz-placeholder {
    color: transparent;
}

#searchBox:focus:-ms-input-placeholder {
    color: transparent;
}

#searchCancel {
    top: 14px !important;
    right: 14px !important;
    width: 14px !important;
    height: 14px !important;
    display: none !important;
}

#searchCancel > svg > line {
    stroke: #8d9398;
    stroke-width: 2;
}

#searchCancel:hover > svg > line {
    stroke: #c55044 !important;
}

