@media only screen and (max-width: 800px) {
    /* For mobile phones: */
    #pageContainer {
        margin-top: 0px;
        position: relative;
        background-color: #e6f2ff;
        top: 40px;
    }

    #header {
        height: 70px;
    }

    .saveButton,
    .showCompletedButton,
    #helpButton {
        position: absolute;
        top: 35px;
        display: block;
    }

    .saveButton {
        margin-left: 45%;
    }

    #helpButton {
        right: 0px;
    }

    .showCompletedButton {
        left: 0px;
    }

    #documentView {
        padding: 0;
        overflow: hidden;
    }

    #savedViewHUD {
        margin-top: 20px !important;
    }
}

