    padding: 10px !important;
}

.savedViewPage {
    display: block !important;
    height: auto !important;
    width: 100% !important;
    margin-bottom: 3px !important;
    padding: 10px !important;
    opacity: .8 !important;
}

.savedViewPageFader {
    display: none !important;
}

.savedViewPageSearchStringContainer {
    margin-top: 0 !important;
}

